import React, { Component } from "react";
import CardList from "./CardList";
import SearchBox from "./SearchBox";
import { memes } from "./Meme";

const state = {};

class App extends Component {
  constructor() {
    this.state = {
      memes: memes,
      searchfield: "",
    };
  }
  render() {
    return (
      <div className="tc">
        <h1>Meme Browser</h1>
        <SearchBox />
        <CardList memes={memes} />
      </div>
    );
  }
}

export default App;
